        # Call the merge_sort function
        # merge_sort(points)
        
        def quick_sort(arr):
            if len(arr) <= 1:
                return arr

            pivot = arr[len(arr) // 2][0]
            left = [x for x in arr if x[0] < pivot]
            middle = [x for x in arr if x[0] == pivot]
            right = [x for x in arr if x[0] > pivot]

            return quick_sort(left) + middle + quick_sort(right)

        # Call the quick_sort function
        sorted_points = quick_sort(points)
        res = 0
        for i in range(n - 1):
            res = max(sorted_points[i + 1][0] - sorted_points[i][0], res )
        return res

